import React from 'react'
import { BrowserRouter as Router, Route } from "react-router-dom";
import User from '../components/user';

function UserRouter() {
    return(
        <Router>
            <Route exact path = '/' component = {User}/>
        </Router>
    )
}

export default UserRouter
